import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  { field: 'userName', headerName: 'Username', width: 130 },
];

const rows = [
  { id: 1, userName: "rMoore"},
  { id: 2, userName: "cMcEachern"},
  { id: 3, userName: "mRoberts"},
  { id: 4, userName: "dConnell"},
  { id: 5, userName: "pHogan"},
  { id: 6, userName: "jPerrin"},
  { id: 7, userName: "nDiMartino"},
  { id: 8, userName: "cLaird"},
  { id: 9, userName: "bBrown"},
  { id: 10, userName: "aWalde"},
];

export default function DataTable() {
  return (
    <div style={{ height: 400, width:"50%", alignContent:"center"}}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  );
}
